import React from 'react';
import { useNavigate } from 'react-router-dom';

function Error() {
  const navigate = useNavigate();
  
  return (
    <div
      style={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        height: '100vh', // Full viewport height
        width: '100vw',  // Full viewport width
        textAlign: 'center',
        backgroundColor: '#f8f9fa', // Subtle background for better visibility
      }}
    >
      <h1 style={{ color: 'red', fontSize: '3rem', marginBottom: '1rem' }}>404 Error</h1>
      <p style={{ fontSize: '1.25rem', color: '#6c757d' }}>Page not found</p>
      <button
        className="btn btn-success"
        onClick={() => navigate('/')}
        style={{
          padding: '10px 20px',
          fontSize: '1rem',
          cursor: 'pointer',
          marginTop: '1rem',
          borderRadius: '5px',
        }}
      >
        Home
      </button>
    </div>
  );
}

export default Error;
